import React from "react";
import { Card } from 'hero-design'

export default function DocumentCard({ cardInfor }: { cardInfor: any }) {
    return (
        <>
            <Card
                key={cardInfor.id}
                id={cardInfor.id}
                header={cardInfor.title}
                content={cardInfor.description}
            >
            </Card>
        </>
    )
}
